window.bookSummaryJSON = "<p><b>The first novel in Lee Child's number one </b><b><i>New York Times</i></b><b> best-selling Jack Reacher series - soon to be an original series on Prime Video!</b></p> <p>“From its jolting opening scene to its fiery final confrontation, <i>Killing Floor</i> is irresistible.” (<i>People</i>)</p> <p>Ex-military policeman Jack Reacher is a drifter. He’s just passing through Margrave, Georgia, and in less than an hour, he’s arrested for murder. Not much of a welcome. All Reacher knows is that he didn’t kill anybody. At least not here. Not lately. But he doesn’t stand a chance of convincing anyone. Not in Margrave, Georgia. Not a chance in hell.</p>"; 
